import './css/App.css';

function CaseStudies() {
  return (
          <div className=" row CaseStudies-body">   
                         <div className='col-md-6 content-image'>
                           <img src={casebody} alt='case-study-placeholder' className='case-img'/>
                        </div>
                        <div className="col-md-6 content-details">
                            <p className='tagline overtext'>
                                <span> Egwu Records is a platform for discovering music of yesterday today. Egwu allows people create playlists about old artistes, write reviews about old albums and exchange, buy and trade records.</span>
                            </p>
                           <button><a href="https://www.notion.so/Case-Study-a603be3b9e244798854814a37880807a" className="case-link">View more</a></button>
                        </div>    
                </div>
  );
}

export default CaseStudies;
